        end
        %
        switch freqDisc
            case {'EqualEnergy'}
                m0 = trapz(freq,abs(S_f));
                numBins = numFreq+1;
                a_targ = m0/(numBins);
                SF = cumtrapz(freq,S_f);
                wn(1) = 1;
                for kk = 1:numBins
                    jj = 1;
                    tmpa{kk}(1) = 0;
                    while tmpa{kk}(jj)-kk*a_targ < 0
                        tmpa{kk}(jj+1) = SF(wn(kk)+jj);
                        jj = jj+1;
                        if wn(kk)+jj >=length(S_f)
                            break
                        end
                    end
                    [a_targ_real(kk),wna(kk)] = min(abs(tmpa{kk}-kk*a_targ));
                    wn(kk+1) = wna(kk)+wn(kk);
                    a_bins(kk) = trapz(freq(wn(kk):wn(kk+1)),abs(S_f(wn(kk):wn(kk+1))));
                end
                w = 2*pi*freq(wn(2:end-1));
                dw = [w(1)-2*pi*freq(wn(1)); diff(w)];
                S = S(wn(2:end-1));                             % Wave Spectrum [m^2-s/rad] 
        end
        A = 2 * S;                                              % Wave Amplitude [m]
  
k = w.^2./g;
if deepWaterWave == 0
    for i=1:100
        k = w.^2./g./tanh(k.*waterDepth);
    end
end


