            waveAmpTime3(i,1)   = t;
            waveAmpTime3(i,2)   = waveAmpTime3(i,2) + sum(tmp13)*(1+cos(pi+pi*(i-1)/maxRampIT))/2;
        end
    end
    for i=maxRampIT+1:maxIt+1
        for idir=1:length(waveDir)
            t = (i-1)*dt;
            tmp=sqrt(A.*df*waveSpread(idir));
            tmp1  = tmp.*real(exp(sqrt(-1).*(w.*t + phase(:,idir))));
