            tmp12 = tmp.*real(exp(sqrt(-1).*(w.*t - k*(wavegauge2loc(1).*cos(waveDir(idir)*pi/180) + wavegauge2loc(2).*sin(waveDir(idir)*pi/180)) + phase(:,idir))));
            tmp13 = tmp.*real(exp(sqrt(-1).*(w.*t - k*(wavegauge3loc(1).*cos(waveDir(idir)*pi/180) + wavegauge3loc(2).*sin(waveDir(idir)*pi/180)) + phase(:,idir))));
            waveAmpTime(i,1)    = t;
